      SELECT col1 * ( + 88 ) * + col0 AS col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE col0 + - ( - 16 ) NOT IN ( ( - col0 ) * + - 70 );
  - name: tab1

outputs:
